INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (0, 0, 0, "", 40000, 91002, 8, "", 1, 100, 36);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (1, 107501, 0, "ぺコリーヌ", 40001, 91002, 8, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 1, 150, 37);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (1, 107601, 0, "コッコロ", 40001, 91002, 8, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 2, 150, 38);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (1, 107801, 0, "キャル", 40001, 91002, 8, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 3, 150, 39);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (1, 107701, 0, "スズメ", 40001, 91002, 8, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 4, 150, 40);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (1, 107901, 0, "タマキ", 40001, 91002, 8, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 5, 150, 41);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, 107501, 0, "ぺコリーヌ", 40001, 91002, 8, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 6, 150, 42);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, 107601, 0, "コッコロ", 40001, 91002, 8, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 7, 150, 43);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, 107801, 0, "キャル", 40001, 91002, 8, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 8, 150, 44);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, 107701, 0, "スズメ", 40001, 91002, 8, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 9, 150, 45);
INSERT INTO `v1_c66b32e86afd44a7a1188fb08fb2278446af7fd7bf57d1d0cfd9e67cd3d55a7e` VALUES (2, 107901, 0, "タマキ", 40001, 91002, 8, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 10, 150, 46);
